import webpush from "web-push";

const keys = {
  publicKey:
    "BC5frPVyX5VqaUU-pwEbevfYjqBMymWollYD1ImZ4BTPbqsFnyN64dLCqwLAWtYjQ7b2DVS5yGLbVelgEIfdDyU",
  privateKey: "",
};

webpush.setVapidDetails(
  "mailto:qkrqudan0428@naver.com",
  keys.publicKey,
  keys.privateKey
);

webpush.sendNotification(
  {
    endpoint: "",
    keys: { p256dh: "", auth: "" },
  },
  "Hello, World!"
);
